import React, { Fragment } from "react";
import { Outlet } from "react-router-dom";

const Header = () => {
    return (
        <Fragment>
          <div className="navigation">
              <div><h1>Comfort</h1></div>
          </div>
          <Outlet/>
        </Fragment>
    )
  }

export default Header;
